import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Holder from './ProductHolder';
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function NestedGrid() {
  const classes = useStyles();

  function FormRow1() {
    return (
      <React.Fragment>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-1" productlabel="product-1"/></Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-2" productlabel="product-2"/></Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-3" productlabel="product-3"/></Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-4" productlabel="product-4"/></Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-5" productlabel="product-5"/></Paper>
        </Grid>
      </React.Fragment>
    );
  }

  /*function FormRow2() {
    return (
      <React.Fragment>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-4" productlabel="product-4"/></Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}><Holder link="./product-5" productlabel="product-5"/></Paper>
        </Grid>
      </React.Fragment>
    );
  }*/

  return (
    <div className={classes.root}>
      <Grid container spacing={1}>
        <Grid container item xs={12} spacing={3}>
          <FormRow1 />
        </Grid>
        <Grid container item xs={12} spacing={3}>
          <FormRow2 />
        </Grid>
      </Grid>
    </div>
  );
}

